// instead of react router, to reach this file would be example.com/, which is based on the file name
import React from 'react';
import Link from 'next/link';

const IndexPage = () => {
  return (
    <div>
      <h1>The Main Page</h1>
      <p>
        Go to <Link href="/auth">Auth</Link>
      </p>
    </div>
  );
};

export default IndexPage;
